import classes from './BookItem.module.css';


const BookItem = (props) => {
    return (
        <li>
            <div>
                <h3>{props.title}</h3>
                <p>{props.subtitle}</p>
                <div>{props.description}</div>
                <a href={props.website}>{props.website}</a>
            </div>
        </li>
    )
}

export default BookItem;
